INSERT INTO `calls` (`id`, `user_id`, `customer_id`, `caller_name`, `company_name`, `phone_number`, `description`, `reminder`, `remind_date`, `remind_time`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 1, 146, 'Mees', NULL, '0611426966', '<p>Mees heeft gebeld om te vragen hoe het met Kevin ging.</p>', NULL, NULL, NULL, '2021-09-13 05:34:15', '2021-09-10 10:17:32', '2021-09-13 05:34:15'),
(2, 2, 170, 'Lucas', NULL, '0575514223', '<p>Lucas wilt graag dat je hem even terugbelt</p>', 1, '2021-09-13', NULL, '2021-09-13 13:15:52', '2021-09-13 12:24:58', '2021-09-13 13:15:52'),
(3, 2, 73, 'Werkmax', NULL, '0630953548', '<p>Hadden gebeld omdat hun website al een week lang niet meer te vinden is via google, zou je hun daarvoor terug kunnen bellen om dat met hun op te lossen?</p>', 1, '2021-09-14', NULL, '2021-09-15 05:20:03', '2021-09-14 07:36:29', '2021-09-15 05:20:03'),
(4, 2, 23, 'Francisca', NULL, '0598393704', '<p>Of je haar even een mail kan sturen met hoe ze kan inloggen.<br />De wachtwoord reset functie werkt namelijk niet.</p>', NULL, NULL, NULL, '2021-10-15 11:31:01', '2021-09-16 07:17:37', '2021-10-15 11:31:01'),
(5, 2, 182, 'Job', NULL, '0630953548', '<p>Heeft al eerder contact opgenomen. Bedrijf is niet zichtbaar op google.&nbsp;</p><p>Wil hier nu graag een oplossing voor.&nbsp;</p>', NULL, NULL, NULL, '2021-09-28 04:52:00', '2021-09-17 06:08:51', '2021-09-28 04:52:00'),
(6, 1, NULL, 'Test', NULL, '0507001518', '<p>Test</p>', NULL, NULL, NULL, '2021-09-20 06:45:51', '2021-09-17 07:02:47', '2021-09-20 06:45:51'),
(7, 2, NULL, 'Giel Meendering', NULL, '0624604203', '<p>Hij had nog wat vragen over de offerte.</p>', NULL, NULL, NULL, '2021-09-28 04:51:56', '2021-09-24 09:45:56', '2021-09-28 04:51:56'),
(8, 2, 185, '-', NULL, '0513650500', '<p>Of je haar terug wilt bellen, ze heeft de volgende vragen:<br />- Website verhuiscode heeft ze&nbsp; nu, wat nu?<br />- Ze krijg 10 spam mailtjes per dag binnen van de website.<br />- Tekst aanpassen via opencart, hoe kan ze dat doen?</p>', NULL, NULL, NULL, '2021-10-15 11:31:04', '2021-09-28 09:30:51', '2021-10-15 11:31:04'),
(9, 1, 92, NULL, NULL, '0599616118', '<p>--&gt; 2021 moet 2022 worden.&nbsp;</p><p>Je kunt haar eventueel hier vanmiddag over&nbsp;bellen.&nbsp;</p>', NULL, NULL, NULL, '2021-10-22 07:41:27', '2021-10-06 07:07:25', '2021-10-22 07:41:27'),
(10, 2, 73, 'Job', NULL, '0630953548', '<p>Ze zeggen dat de website nog steeds &#39;offline&#39; oftwel niet vindbaar is in google</p>', NULL, NULL, NULL, '2021-11-30 12:48:22', '2021-10-07 07:30:05', '2021-11-30 12:48:22'),
(11, 2, 107, '-', NULL, '0115648070', '<p>Hij wil graag even met jou sparren over het in 1x kunnen verwerken van bestellingen en over de mogelijkheid van inpakpapier bij het bestellen.</p>', NULL, NULL, NULL, '2021-10-11 09:39:41', '2021-10-08 08:08:42', '2021-10-11 09:39:41'),
(12, 2, 179, 'Wilfred', NULL, '0615278700', '<p>Graag even terugbellen</p>', NULL, NULL, NULL, '2021-10-12 12:15:27', '2021-10-11 06:03:41', '2021-10-12 12:15:27'),
(13, 2, 191, 'Geert', NULL, '0634104561', '<p>Hij kan niet meer bij zijn roundcube mail komen, meneer begreep niet wat ik bedoelde met URL/domein. Hij zei dat hij via roundcub/webmail naar zijn mail toe ging.<br /><br />Ik kwam er dus met meneer niet helemaal uit, heb aangegeven dat je hem wel even belt.<br />Ik kon zijn naam niet heel goed verstaan, dus dit is vast weer Claudia ipv Geert ;)</p>', NULL, NULL, NULL, '2021-10-12 12:18:19', '2021-10-11 12:56:56', '2021-10-12 12:18:19'),
(14, 2, 192, 'Robert jan', NULL, '0653425229', '<p>Hij wil graag drukwerk bestellen, of je hem daarover wilt terug bellen.</p>', NULL, NULL, NULL, '2021-12-13 18:34:57', '2021-10-13 09:35:33', '2021-12-13 18:34:57'),
(15, 2, 155, 'Lokken', NULL, '0646025484', '<p>Hij il graag dat je even terug belt</p>', NULL, NULL, NULL, '2021-10-14 11:52:19', '2021-10-14 05:44:49', '2021-10-14 11:52:19'),
(16, 2, 193, 'Bert', NULL, '0653118901', '<p>Heeft een aantal vragen over de agende + colofoon</p><p>En of die ook een korte cursus kan krijgen hoe alles werkt.&nbsp;</p>', NULL, NULL, NULL, '2021-10-20 09:51:02', '2021-10-15 06:32:34', '2021-10-20 09:51:02'),
(17, 2, 88, 'Janneke', NULL, '0636555187', NULL, NULL, NULL, NULL, '2021-10-15 11:31:10', '2021-10-15 06:46:54', '2021-10-15 11:31:10'),
(18, 1, 194, NULL, NULL, '0646835122', '<p>Deze man zoekt jou!</p><p>WANTED!!!</p>', NULL, NULL, NULL, '2021-10-19 08:58:06', '2021-10-15 06:47:59', '2021-10-19 08:58:06'),
(19, 2, NULL, 'Lenard', NULL, '0612610518', '<p>Had vorige week ook al gebeld.&nbsp;</p><p>Wil graag terug gebeld worden.&nbsp;</p>', NULL, NULL, NULL, '2021-11-23 12:45:02', '2021-10-20 11:09:27', '2021-11-23 12:45:02'),
(20, 1, 113, NULL, NULL, '0646835122', '<p>Graag even terugbellen inverband met een fout in het systeem. Als je de offerte wilt genereren wordt alles er uit gegooid.</p>', NULL, NULL, NULL, '2021-10-22 07:41:24', '2021-10-20 12:01:12', '2021-10-22 07:41:24'),
(21, 2, 88, 'Diana', NULL, '0636555187', '<p>Of je haar terug kan bellen, ze wil graag weten of ze nu alles kwijt is wat ze vanmorgen gedaan heeft. En de admin werkt nog steeds niet.</p>', NULL, NULL, NULL, '2021-10-25 11:12:13', '2021-10-21 11:48:47', '2021-10-25 11:12:13'),
(22, 2, 167, 'Lenard', NULL, '0103412045', '<p>Of je hem terug kan bellen.</p>', NULL, NULL, NULL, '2021-11-08 07:39:23', '2021-10-21 11:50:57', '2021-11-08 07:39:23'),
(23, 2, 34, '-', NULL, '0652330169', '<p>Meneer had jou een foto/bericht gestuurd met iets, of je hem daar even over wilt terug bellen.</p>', NULL, NULL, NULL, '2021-11-03 07:29:24', '2021-10-29 09:32:42', '2021-11-03 07:29:24'),
(24, 2, NULL, 'Giel Meendering', NULL, '0624604203', '<p>Of je hem terug kunt bellen.</p>', NULL, NULL, NULL, '2021-11-18 12:46:57', '2021-10-29 10:04:47', '2021-11-18 12:46:57'),
(25, 2, 196, 'Frank', NULL, '0599412900', '<p>Even terug bellen, vragen naar frank</p>', NULL, NULL, NULL, '2021-11-12 09:32:28', '2021-11-08 08:03:01', '2021-11-12 09:32:28'),
(26, 2, 99, 'Renee', NULL, '0224212239', '<p>Kun je hem terugbellen over de prijzen van de producten?<br />Hij heeft hier wat vragen over maar hij wist zelf niks van zijn webshop, dus ik kon het niet beantwoorden.</p>', NULL, NULL, NULL, '2021-12-13 18:34:52', '2021-11-11 08:10:25', '2021-12-13 18:34:52'),
(27, 2, 199, '-', NULL, '0650512678', '<p>Ze wouden graag de website offline hebben maar hun mailbox wel behouden.<br />Als het nummer niet werkt kon je het proberen op&nbsp;0650512677.<br />Ze wou graag even weten of dat erg scheelt in de kosten etc.</p>', NULL, NULL, NULL, '2021-11-23 14:45:43', '2021-11-12 12:33:50', '2021-11-23 14:45:43'),
(28, 2, NULL, 'Giel Meendering', NULL, '0624604203', '<p>Of je hem terug wilt bellen.</p>', NULL, NULL, NULL, '2021-11-18 12:46:54', '2021-11-16 09:15:36', '2021-11-18 12:46:54'),
(29, 2, 157, 'Moolen', NULL, '0615511402', '<p>Wil je zo snel mogelijk terug bellen? Hij is nog niet helemaal met het design eens</p>', NULL, NULL, NULL, '2021-11-23 14:45:40', '2021-11-17 12:06:26', '2021-11-23 14:45:40'),
(30, 2, 107, 'Martino', NULL, '0115648070', '<p>Of je hem terug kan bellen, hij loopt nu al een poosje vast.</p>', NULL, NULL, NULL, '2021-11-23 14:45:37', '2021-11-17 13:30:47', '2021-11-23 14:45:37'),
(31, 2, 186, 'Marjolein Keizer', NULL, '0653715744', '<p>Graag naar 13.00uur contact opnemen.&nbsp;</p><p>Wil graag haar opties over de domeinnamen bespreken.&nbsp;</p>', NULL, NULL, NULL, '2021-11-23 12:45:10', '2021-11-22 08:55:56', '2021-11-23 12:45:10'),
(32, 2, 167, 'Lennard', NULL, 'Goudsmith Bastijn', '<p>Graag alle openingstijden aanpassen naar 10:00 tot 17:00 de dagen dat de dicht zijn gewoon dicht laten</p>', NULL, NULL, NULL, '2021-11-23 14:28:01', '2021-11-23 12:35:52', '2021-11-23 14:28:01'),
(33, 2, 109, 'Jane', NULL, '0614334827', '<p>Kun je haar terugbellen over de maillijst.&nbsp;</p><p>Deze wil ze graag bekijken.&nbsp;</p>', NULL, NULL, NULL, '2021-11-23 14:45:33', '2021-11-23 12:43:08', '2021-11-23 14:45:33'),
(34, 2, 88, 'Janneke', NULL, '0636555187', '<p>Heeft een bestelling uit Frankrijk ontvangen</p><p>Dit is niet goed gegaan. Ze wil dit nu graag inkijken.&nbsp;</p>', NULL, NULL, NULL, '2021-11-24 15:20:39', '2021-11-24 12:53:16', '2021-11-24 15:20:39'),
(35, 2, 200, 'melanie', NULL, '0881662300', '<p>afspraak verzetten</p>', NULL, NULL, NULL, '2021-12-01 14:40:21', '2021-11-30 09:56:01', '2021-12-01 14:40:21'),
(36, 2, 202, 'Frank', NULL, '0646483005', '<p>Groningen</p><p>Promotiedagen</p>', NULL, NULL, NULL, '2021-12-01 11:38:01', '2021-12-01 10:01:43', '2021-12-01 11:38:01'),
(37, 2, 203, 'Edward Staal', NULL, '0630827732', '<p>Graag terugbellen</p>', NULL, NULL, NULL, '2022-03-01 17:46:59', '2021-12-08 13:15:33', '2022-03-01 17:46:59'),
(38, 2, 204, '-', NULL, '0644603024', '<p>Meneer kon niet op zijn mail, stond op de blacklist.<br />Dit heb ik opgelost en hem de webmail laten zien.<br />Kun je hem nog even helpen met het instellen van zijn outlook?</p>', NULL, NULL, NULL, '2022-01-03 14:06:03', '2021-12-16 08:45:31', '2022-01-03 14:06:03'),
(39, 2, 205, 'Marko', NULL, '0334614161', '<p>Of je hem terug kan bellen over zijn slider, deze werkt niet meer en volgens Wilco (Epura) lag het aan de opencart versie. Maar Wilco had hem doorverwezen naar ons.<br /><br />Mag ook op zijn mobiele nummer 0623991673</p>', NULL, NULL, NULL, '2021-12-21 14:46:57', '2021-12-21 08:27:25', '2021-12-21 14:46:57'),
(40, 1, 87, 'Katharina', NULL, '0334614161', '<p>Of je haar even kan helpen met een maten tabel bij de ringen, ze is er al mee bezig geweest en heeft wat dingen aangepast maar dit wordt dan niet zichtbaar bij de ringen. Ze vroeg zich af of jij hier nog wat voor moet aanpassen/aanzetten ofzo.</p>', NULL, NULL, NULL, '2021-12-21 09:50:51', '2021-12-21 09:50:26', '2021-12-21 09:50:51'),
(41, 2, 87, 'Katharina', NULL, '0334614161', '<p>Of je haar even kan helpen met een maten tabel bij de ringen, ze is er al mee bezig geweest en heeft wat dingen aangepast maar dit wordt dan niet zichtbaar bij de ringen. Ze vroeg zich af of jij hier nog wat voor moet aanpassen/aanzetten ofzo.</p>', NULL, NULL, NULL, '2022-02-08 08:53:34', '2021-12-21 09:50:48', '2022-02-08 08:53:34'),
(42, 1, 56, '-', NULL, '0591577527', '<p>Wij hosten hun webshop maar hij kan er niet in.<br />Of je hem kan bellen.</p>', NULL, NULL, NULL, '2022-01-04 09:50:52', '2022-01-04 09:36:48', '2022-01-04 09:50:52'),
(43, 1, 19, '-', NULL, '0641819989', '<p>Voicemail eraf halen want die moest er al af zijn vandaag.<br />En haar terug bellen om te zeggen als het klaar is.</p>', NULL, NULL, NULL, '2022-01-12 11:09:36', '2022-01-10 13:28:26', '2022-01-12 11:09:36'),
