INSERT INTO `notes` (`id`, `created_at`, `updated_at`, `title`, `body`, `date_added`, `user_id`, `project_id`) VALUES
(6, NULL, NULL, 'Dakpanvernieuwing', '<p>- offerte wijzigen, andere dakpan selecteren. Hoe kunnen we dit doen?</p>\r\n\r\n<p>- Kan alles wat niet een pan is vast staan bij het wijzigen?&nbsp;</p>\r\n\r\n<p>- Bij offerte wijzigen, de oude ook opslaan, als soort archief. kan dat?&nbsp;<br />\r\n- Bij wijzigen van de offerte en versturen dan ook een nieuw nummer aan geven.&nbsp;</p>\r\n\r\n<p>- Korting product toevoegen, waar min bedrag kan. en die niet afhankelijk is van de marge die is ingevuld.</p>\r\n\r\n<p>- excl btw pdf maken voor aannemer. in de tekst benoemen: BTW verlegt naar (naam van klant)</p>\r\n\r\n<p>- Kraandagen staat gekoppeld aan werkdagen. maar als hij wordt aangepast en opgeslagen en je bekijkt hem daarna weer staat hij weer terug naar de werkdagen.</p>\r\n\r\n<p>- bij oppervlakte totaal bedrag, veldje erbij met een getal invullen, wat ook een min getal kan zijn. zodat het totaal aantal m2 wordt aangepast.</p>\r\n\r\n<p>- zonnepanelen, dakramen, cv pijp, dakraam plaatsen, dakraam afwerking, moeten standaard uit de lijst.</p>\r\n\r\n<p>- knop terug in het systeem tijdens maken van de offerte.&nbsp;</p>\r\n\r\n<p>- Materiaallijst, bovenaan adres en naam van de klant<br />\r\n- Aantal werkdagen ook er op</p>\r\n\r\n<p>- Materiaallijst kijken of er mogelijkheid is voor notitie toe te voegen.&nbsp;</p>', '22-03-2022', 5, 17),
(9, NULL, NULL, 'Netfiets', '<p>Hoi Martin, eerder kregen we de orders binnen met de artikelnummers op alfabetische volgorde. Dit is toen aangepast naar de volgorde van invoer. Kan dit weer op alfabetische?</p>', '27-06-2022', 1, 70),
(16, NULL, NULL, 'Todo\'s', '<p>1. Offerte maken voor doddema voor vakantiedagen en rooster.<br />\r\n2. Offerte VikaKunstof opnieuw bekijken voor de webshop.<br />\r\n3. Visitekaartjes voor Natasha, voor de promotiedagen.</p>', '28-10-2022', 2, 1);
