(119, 193, 5, NULL, 'Kroniek updaten', '<p><strong>Kroniek</strong><br />- Je kan nu zoeken op de inhoud van de hoofdstukken<br />- Je kan meerdere foto&#39;s uploaden bij een hoofdstuk<br />- De lijst met alle hoofdstukken wordt smaller&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;<strong>WHB</strong><br />- Je kan nu meerdere foto&#39;s toevoegen aan de woningen, tijdlijnen en dorpen<br />- Je kan nu ook filmpjes toevoegen aan de woningen, tijdlijnen en dorpen doormiddel van een linkje vanuit YouTube.<br />- Je kan nu ook zoeken op de inhoud van woningen, deze werd eerst nog niet gevonden.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;<strong>Bewoners Uitnodigen</strong><br />- De mensen die een account willen hebben komen op een pagina terecht waar ze hun postcode en huisnummer kunnen invullen<br />- Zodra dat is ingevuld komen ze op een pagina terecht waar ze hun email en wachtwoord kunnen instellen<br />- Zodra dat is gedaan checkt het systeem of er een woning bestaat, zo ja dan zal het systeem de woning aan die gebruiker koppelen.<br />- Zodra dat is gedaan kan de gebruiker inloggen</p>', 1, 13, '75.00', 'Afgerond', NULL, '2022-07-06 12:16:04', '2022-10-05 04:12:03'),
