(1, 22, NULL, 1, 94, 'Bugs', 'Status verwijderd', '<p>Wanneer uren verwijderd worden moeten deze ook uit de lijst gehaald worden.</p>', 'Afgerond', '2021-09-13', 1, NULL, '2021-09-13 07:42:11', '2021-09-13 11:29:38'),
(2, 22, NULL, 1, NULL, 'Jaarfacturen', 'Per klant', '<p>Per klant moet de jaarfactuur voor dit jaar gedownload kunnen worden.</p>', 'Open', NULL, NULL, NULL, '2021-09-13 07:42:54', '2021-09-13 07:42:54'),
(3, 22, NULL, 1, NULL, 'Jaarfacturen', 'Alles in 1x', '<p>Alle openstaande jaarfacturen downloaden.</p>', 'Afgerond', '2021-09-17', 1, NULL, '2021-09-13 07:43:08', '2021-09-17 09:16:15'),
(4, 22, NULL, 1, 94, 'Bugs', 'Uren status', '<p>De uren status verdwijnd na het invullen van de uren.</p>', 'Afgerond', '2021-09-13', 1, NULL, '2021-09-13 09:28:53', '2021-09-13 11:29:38'),
(5, 22, NULL, 1, 94, 'Features', 'Snel project zoeken', '<p>Via het dashboard in 1x naar een project kunnen navigeren, om zo de todo&#39;s etc. te bekijken.</p>', 'Afgerond', '2021-09-13', 1, NULL, '2021-09-13 09:30:05', '2021-09-13 11:29:38'),
(6, 24, NULL, 1, 320, 'Extra werk', 'header', '<p>De header op de homepagina vervangen door een slider met circa. 5 foto&rsquo;s.</p>', 'Afgerond', '2021-10-01', 1, NULL, '2021-09-14 11:31:57', '2021-10-01 12:42:21'),
(7, 24, NULL, 1, NULL, 'Extra werk', 'Menu', '<p>Het menu anders opstellen zodat de focus op de zoekbalken ligt</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:32:29', '2021-09-14 11:32:29'),
(8, 24, NULL, 1, NULL, 'Extra werk', 'Zoekvelden aanpassen', '<p>De zoekvelden op de home pagina aanpassen naar:<br /><br />Waar (gebied)<br />Wanneer (vertrekdatum)<br />Hoelang (aantal dagen/week)<br />Aantal personen</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:33:10', '2021-09-14 11:33:10'),
(9, 24, NULL, 1, 320, 'Extra werk', 'Filteren', '<p>Huisjes kunnen zoeken op basis van registratie nummer</p>', 'Afgerond', '2021-10-01', 1, NULL, '2021-09-14 11:33:24', '2021-10-01 12:42:21'),
(10, 24, NULL, 1, NULL, 'Extra werk', 'Filteren', '<p>De nieuwe landkaart inbouwen bij de filters</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:33:33', '2021-09-14 11:33:33'),
(11, 24, NULL, 1, NULL, 'Extra werk', 'Agenda', '<p>De boekingsagenda duidelijker maken met kleuren</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:33:42', '2021-09-14 11:33:42'),
(12, 24, NULL, 1, NULL, 'Extra werk', 'Standaardzinnen', '<p>Voor de beschrijvingen van de huisjes moeten er duidelijkere zinnen komen</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:33:58', '2021-09-14 11:33:58'),
(13, 24, NULL, 1, NULL, 'Extra werk', 'Iconen', '<p>Meer met iconen werken zoals een check of een kruisje etc</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:34:06', '2021-09-14 11:34:06'),
(14, 24, NULL, 1, NULL, 'Extra werk', 'Huisjes', '<p>Meer info laten zien in de tabellen bij de huisjes.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:34:21', '2021-09-14 11:34:21'),
(15, 24, NULL, 1, NULL, 'Extra werk', 'Filteren', '<p>De huisdieren filter verbeteren, nu staat er alleen &ldquo;Huisdieren toegestaan&rdquo;</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:34:32', '2021-09-14 11:34:32'),
(16, 24, NULL, 1, NULL, 'Extra werk', 'Huisjes', '<p>Huis nummers duidelijker weergeven, direct al bij het overzicht van huisjes</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:34:42', '2021-09-14 11:34:42'),
(17, 24, NULL, 1, NULL, 'Extra werk', 'Filteren', '<p>Ook kunnen filteren op soorten huisjes. (appartement of huisje)</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:34:57', '2021-09-14 11:34:57'),
(18, 24, NULL, 1, NULL, 'Extra werk', 'Filteren', '<p>Mogelijkheid inbouwen voor +/- vertrekdatum.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:35:04', '2021-09-14 11:35:46'),
(19, 24, NULL, 1, NULL, 'Extra werk', 'Filteren', '<p>Prijs filter inbouwen met vaste bedragen i.p.v. vrije invoer</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:35:17', '2021-09-14 11:35:17'),
(20, 24, NULL, 1, NULL, 'Extra werk', 'Mobiel', '<p>Ook voor de mobiel moet de filter goed in te vullen zijn.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:35:28', '2021-09-14 11:35:28'),
(21, 24, NULL, 1, NULL, 'Extra werk', 'Filteren', '<p>De gehele filter functie moet makkelijker en duidelijker worden.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:35:39', '2021-09-14 11:35:39'),
(22, 24, NULL, 1, NULL, 'Bugs', 'Filteren', '<p>Bij het filteren wordt er geen rekening gehouden met de min/max bedragen</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:36:06', '2021-09-14 11:36:06'),
(23, 24, NULL, 1, NULL, 'Bugs', 'Filteren', '<p>Er zit een fout bij het zoeken op gebied. (Gebeurd soms, dus goed testen)</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:36:16', '2021-09-14 11:36:16'),
(24, 24, NULL, 1, NULL, 'Bugs', 'Boeken', '<p>De keuze voor linnengoed is er niet bij het boeken, dit moet erbij komen.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:36:28', '2021-09-14 11:36:28'),
(25, 24, NULL, 1, NULL, 'Bugs', 'Filteren', '<p>Duidelijker aangeven hoeveel zoekresultaten er zijn gevonden, dit is onduidelijk</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:36:35', '2021-09-14 11:36:35'),
(26, 24, NULL, 1, NULL, 'Bugs', 'Filteren', '<p>Na het filteren van een regio wordt er niet ge-update.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:36:48', '2021-09-14 11:36:48'),
(27, 24, NULL, 1, 320, 'Bugs', 'Huisjes', '<p>Header foto van een huisje staat over de header van de home pagina</p>', 'Afgerond', '2021-10-01', 1, NULL, '2021-09-14 11:37:04', '2021-10-01 12:42:21'),
(28, 24, NULL, 1, NULL, 'Bugs', 'Melding', '<p>De corona melding op de home pagina kan eraf.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:37:17', '2021-09-14 11:37:17'),
(29, 24, NULL, 1, NULL, 'Bugs', 'Footer', '<p>In de footer een linkje maken voor een eventuele corona maatregelen etc</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:37:25', '2021-09-14 11:37:25'),
(30, 24, NULL, 1, NULL, 'Bugs', 'Huisjes', '<p>Plaatsen worden nu vaak weergegeven als provincie, dit moet specifieker</p>', 'Open', NULL, NULL, NULL, '2021-09-14 11:37:39', '2021-09-14 11:37:39'),
(31, 15, NULL, 5, NULL, 'Overig', 'Volgorde Projecten Wijzigen', '<p>Je moet de volgorde van de projecten kunnen wijzigen</p>', 'Open', '2021-09-14', 5, NULL, '2021-09-14 11:47:34', '2021-09-14 12:28:22'),
(32, 15, NULL, 5, NULL, 'Modules', 'Popup module', '<p>Popup module toevoegen</p>', 'Afgerond', '2021-12-15', 5, NULL, '2021-09-14 12:14:34', '2021-12-15 14:47:42'),
(33, 15, NULL, 5, NULL, 'Overig', 'Automatische mail inactiviteit', '<p>Er word na 3 maand inactiviteit een mail gestuurd naar de gebruiker</p>', 'Open', '2021-09-14', 5, NULL, '2021-09-14 12:15:45', '2021-09-14 12:28:21'),
(34, 15, 170, 5, NULL, 'Overig', 'Link structuur parameters ombouwen', '<p>De gehele linkstructuur ombouwen van het cms</p>', 'Open', '2021-09-14', 5, NULL, '2021-09-14 12:18:48', '2021-12-15 14:48:23'),
(35, 15, NULL, 5, NULL, 'Overig', 'Error log', '<p>Er word een error log verstuurd naar een onlinebouwers mail als er een fout optreed</p>', 'Open', '2021-09-14', 5, NULL, '2021-09-14 12:22:22', '2021-09-14 12:28:20'),
(36, 15, NULL, 5, NULL, 'Overig', 'Contactformulier optie', '<p>Er word een optie toegevoegd bij het contactformulier om ook een bericht naar de gebruiker zelf te versturen</p>', 'Open', '2021-09-14', 5, NULL, '2021-09-14 12:25:25', '2021-09-14 12:28:20'),
(37, 22, NULL, 1, NULL, 'Bugs', 'Login', '<p>Login scherm is bereikbaar na het inloggen.</p>', 'Afgerond', '2021-09-17', 1, NULL, '2021-09-14 12:52:41', '2021-09-17 09:16:10'),
(38, 22, NULL, 1, NULL, 'Bugs', 'Uren', '<p>Niet meer als 2 decimalen.</p>', 'Open', NULL, NULL, NULL, '2021-09-14 12:52:56', '2021-09-14 12:52:56'),
(39, 15, NULL, 5, 906, 'Modules', 'Html blokken', '<p>Html blokken module opnieuw opbouwen</p>', 'Afgerond', '2021-11-18', 5, NULL, '2021-09-15 05:39:12', '2021-11-18 07:45:40'),
(40, 15, NULL, 5, NULL, 'Modules', 'Blokken Bewerken', '<p>Na Blokken Bewerken Website Refreshen</p>', 'Open', NULL, NULL, NULL, '2021-09-15 10:50:55', '2021-09-15 10:50:55'),
(41, 15, NULL, 5, 148, 'Modules', 'Html Blokken Design', '<p>Html Blokken Design Aanpassen / Duidelijk Maken</p>', 'Afgerond', '2021-09-16', 5, NULL, '2021-09-16 08:42:07', '2021-09-16 08:46:22'),
(42, 22, 170, 1, 473, 'Features', 'Todo\'s Cookie', '<p>Een cookie inbouwen bij het filteren van todo&#39;s, zodat je niet steeds opnieuw hoeft te filteren.<br />Ook kunnen zien dat de filter actief is door de button een ander kleurtje te geven.</p>', 'Afgerond', '2021-10-12', 1, NULL, '2021-09-20 12:50:44', '2021-10-12 12:52:47'),
(43, 22, 170, 1, NULL, 'Bugs', 'Tooltips', '<p>Tooltips werken niet meer nadat er gefiltered is.</p>', 'Open', NULL, NULL, NULL, '2021-09-20 13:00:13', '2021-09-20 13:00:13'),
(44, 22, 170, 1, 473, 'Bugs', 'datum toevoegen', '<p>Als je andere datum selecteerd voor het toevoegen van uren. Dan ook in de module de juiste datum&nbsp;</p>', 'Afgerond', '2021-10-12', 1, NULL, '2021-09-21 08:17:01', '2021-10-12 12:52:47'),
(45, NULL, NULL, 1, NULL, NULL, 'OnlineBouwers Website portfolio', '<p>Categorie drukwerk/vormgeving toevoegen. Zorgen dat de projecten daarvan op de nieuwe vormgeving pagina getoont worden</p>', 'Afgerond', '2021-09-24', 1, NULL, '2021-09-21 09:35:20', '2021-09-24 12:32:24'),
(46, 26, 51, 1, NULL, 'klantportaal', 'klantportaal voor iedere klant', '<p>1. Uitzoeken welke onderdelen nu beschikbaar zijn voor klanten</p><p>2. Script maken dat voor iedere klant een klantportaal aanmaakt</p><p>3. Automatische mail sturen naar alle klanten met hun login gegevens van het portaal</p>', 'Afgerond', '2021-10-12', 1, NULL, '2021-09-21 10:27:34', '2021-10-12 12:36:41'),
