(52, 35, 50, 1, NULL, NULL, 'CRM aanpassing', '<p>Bouwman wil graag bij de facturen tabel (concept en verzonden pagina) een vrije invoer veld hebben die ze zelf kunnen invullen maar ook kunnen aanpassen als hij is ingevuld. dus gewoon een vrije input.&nbsp;</p><p>Status verzonden/herinnering kon er wel af. Om er ruimte voor te maken in de tabel.</p>', 'Afgerond', '2021-09-29', 1, NULL, '2021-09-27 12:43:07', '2021-09-29 12:52:23'),
(53, NULL, NULL, 2, NULL, NULL, 'auto sanders', '<p>koppeling met website controleren</p>', 'Afgerond', '2021-10-08', 2, NULL, '2021-09-29 11:18:18', '2021-10-08 06:20:47'),
