(12, '2021-11-24 18:29:57', '2021-11-24 18:29:57', 2, 'Martin Kok', 'Mail werkt niet', '<p>Controleer of de klant niet op de blacklist staat. Dit kan je doen door de volgende vraag te stellen</p><ul><li>- kan je op de eigen website komen?</li></ul><p>Indien een klant niet op de eigen website kan komen. Dan staat deze hoogstwaarschijnlijk op de blacklist.&nbsp;</p><p>Dit is simpel op te lossen door te gaan naar <a href=\"www.watismijnip.nl\">www.watismijnip.nl</a> en het IP nummer op onze server op de whitelist te plaatsen.</p><p>&nbsp;</p><p>Whitelist op onze server:</p><p>Inloggen in de DirectAdmin omgeving.&nbsp;</p><ul><li>Extra Features &gt; <strong>ConfigServer Security &amp; Firewall</strong></li><li><strong>Zoek naar de groene input veld met de tekst âAllow IP address â</strong></li><li><strong>Vul het IP van de klant hier in en klik op Quick Allow.</strong></li></ul>'),
(13, '2021-11-24 18:37:10', '2021-11-24 18:37:10', 2, 'Martin Kok', 'Blacklist', '<p>Whitelist op onze server:</p><p>Inloggen in de DirectAdmin omgeving.&nbsp;</p><ul><li>Extra Features &gt; <strong>ConfigServer Security &amp; Firewall</strong></li><li><strong>Zoek naar de groene input veld met de tekst âAllow IP address â</strong></li><li><strong>Vul het IP van de klant hier in en klik op Quick Allow.</strong></li></ul>'),
(21, '2021-12-22 08:40:55', '2021-12-22 08:40:55', 5, 'Jesper Bralten', 'Putty Voor Noobs', '<p>Voor deze stappenplan heb je een <strong>Putty </strong>nodig. Download deze <a href=\"https://the.earth.li/~sgtatham/putty/latest/w64/putty-64bit-0.76-installer.msi\">Hier</a>.</p><p>Stappenplan:</p><ol><li>Open putty en voer de ssh gegevens in van de website gebruik poort 2020. <i>Letop! dit moeten wel de hoofdgegevens zijn (de gegevens die je mee krijgt zodra je het domein aanmaakt)</i></li><li>Zodra je op âopenâ of âconnectâ drukt opent een scherm.</li><li>Hier vul je je gebruikersnaam in en het wachtwoord. <i>Letop! het wachtwoord is niet zichtbaar als je dit intypt (<strong>kopieer </strong>je? druk met <strong>rechtermuisknop </strong>in het programma om te <strong>plakken</strong>)</i></li><li>Druk vervolgens op enter om zo in te loggen, lukt dit niet? dan zijn de gegevens fout. <i>Letop! Je kan het maximaal 3x proberen voordat hij je er uit gooit dan sta je op de </i><a href=\"https://ob.customerr.nl/wiki-post/13\"><i><strong>Blacklist</strong></i></a></li><li>vervolgens typ je âcd domainsâ enter.</li><li>vervolgens typ je âcd (<i>domein naam (bijv. ob.customerr.nl))</i>â enter.</li><li>Als het een <strong>cms</strong> project is type je âcd public_htmlâ anders typ je âcd projectâ enter.</li><li>Vervolgens typ je âphp artisan config:clearâ dit zorgt ervoor dat de cache bestanden van de config verwijderd worden en dat hij altijd de actuele configuratie aanneemt.</li><li>Als je het stappenplan juist hebt gevolgd dan zou het nu moeten werken!</li><li>Zoniet, probeer een van deze commandos\':&nbsp;<ol><li>âphp artisan config:clearâ</li><li>âphp artisan view:clearâ</li><li>âphp artisan route:clearâ</li><li>âphp artisan cache:clearâ</li><li>âcomposer dump-autoloadâ</li></ol></li><li>Als deze commando\'s ook niet werken ligt het probleem ergens anders</li></ol><p><br>Commando\'s:&nbsp;</p><ul><li>âlsâ = als je dit intypt krijg je alle mappen te zien waar je heen kan gaan</li><li>âcdâ = als je dit intypt (bijvoorbeeld: <i>âcd projectâ</i>) dan ga je naar de map âprojectâ.</li><li>mkdir = als je dit intypt (bijvoorbeeld: âmkdir projectâ) dan maak je de map âprojectâ aan.</li><li>rm -rf = als je dit intypt (bijvoorbeeld: ârm -rf projectâ) dan verwijder je de map âprojectâ en de inhoud.</li></ul><p>Php Versies:</p><p>&nbsp;</p><p><i>14-7-2022 â12:00â</i></p><p>Als je een foutmelding krijgt kan het zijn dat je de verkeerde php versie hebt je kan hetgeen ook proberen wat hier onder staat</p><ul><li>/usr/local/php73/bin/php73 artisan config:clear</li><li>/usr/local/php73/bin/php73 artisan view:clear</li><li>/usr/local/php73/bin/php73 artisan route:clear</li><li>/usr/local/php73/bin/php73 artisan cache:clear</li></ul>'),
(22, '2022-01-20 09:28:52', '2022-01-20 09:28:52', 2, 'Martin McRocket', 'CMS in Layout inbouwen', '<p>Ga op de server naar de public html map</p><p>&nbsp;</p><p><strong>Stap 1: Index bestand</strong></p><p>In de map: resources/views/templates&nbsp;</p><p>Maak je een nieuw map aan met de naam van de klant</p><p>In deze map plak je het index.html bestand. Vervolgens hernoem je dit bestand naar index.blade.php</p><p>&nbsp;</p><p><strong>Stap 2: Alle opmaak bestanden</strong></p><p>In de map: public/templates</p><p>Maak je een nieuw map aan met dezelfde naam als in de resources map</p><p>Plak alle mappen &amp; bestanden in deze map (alle css, images, etc)</p><p>&nbsp;</p><p><strong>Stap 3: env bestand</strong></p><p>In de public html staat het .env bestand.</p><p>Op regel 10 staat het volgende: SKYTZ_TEMPLATE=</p><p>Achter de = zet je de naam van de map neer die je hebt aangemaakt.</p><p>&nbsp;</p><p><strong>Stap 4: Code inbouwen</strong></p><p>Ga naar de resources/views/templates map en open je index.blade bestand</p><p>Vervolgens open je in de map resources/views/templates/demosite ook het index.blade bestand als voorbeeld</p><p>&nbsp;</p><p>Alle bestanden, plaatjes etc moeten worden ingeladen met de code: {{ template_url(\'/urlpad\') }}</p><p>bijvoorbeeld: {{ template_url(\'/css/style.css\') }}</p><p>&nbsp;</p><ul><li><i>Stap 1 inbouwen</i></li></ul><p>Kopieer deze tekst</p><blockquote><p>&nbsp; &nbsp; &nbsp; &nbsp; &lt;!-- jQuery --&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp;&lt;script src=\"https://code.jquery.com/jquery-1.9.1.min.js\"&gt;&lt;/script&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp;@include(\'templates.admin.partials.plugins\')</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&lt;!-- Main jQuery --&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp;&lt;script src=\"{{ template_url(\'/css/main.js\') }}\"&gt;&lt;/script&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&lt;!-- Larevel --&gt;<br>&nbsp; &nbsp; &nbsp; &nbsp;@yield(\'head\')</p><p>&nbsp; &nbsp; &nbsp; &nbsp;@include(\'templates.admin.partials.analytics\')<br>&nbsp; &nbsp;&lt;/head&gt;<br>&nbsp; &nbsp;&lt;body&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;{{-- Skytz CMS Header --}}<br>&nbsp; &nbsp; &nbsp; &nbsp;@yield(\'header_cms\')</p></blockquote><p>In je eigen index.blade bestand vervang je de&nbsp;</p><p>&lt;/head&gt;</p><p>&lt;body&gt;&nbsp;</p><p>Door dit stukje code</p><p>&nbsp;</p><ul><li><i>Stap 2 inbouwen</i></li></ul><p>Vervolgens begin je bovenaan in je code met het vervangen van de inbouw codes zoals {{ template_url(\'/css/style.css\') }}</p><p>&nbsp;</p><p><i><strong>Let op! Wanneer je helemaal onderaan je code een stukje hebt staan van: js/jquery-2.1.4.min.js deze verwijderen omdat dit al wordt ingeladen met de cms.</strong></i></p><p>&nbsp;</p><ul><li>Stap 3 inbouwen</li></ul><p>Kopieer deze code</p><blockquote><p>@include(\'templates.admin.partials.menu\')</p></blockquote><p>Op de plek van je menu plaats je deze code ipv de UL die je hebt staan.</p><p>&nbsp;</p><p>&nbsp;</p><p>Kopieer deze code</p><blockquote><p>@include(\'templates.admin.partials.content\')</p></blockquote><p>Deze plaats je in de ROW Columns waar je de content wilt plaatsen.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Kopieer deze code</p><blockquote><p>&nbsp; &nbsp; &nbsp; &nbsp; @yield(\'bottom\')</p><p>&nbsp; &nbsp; &nbsp; &nbsp;@include(\'templates.defaults.bottom\')</p></blockquote><p>Plaats dit onderaan je bestand boven het afsluiten van de body</p><p>&nbsp;</p>'),
(23, '2022-06-01 06:11:18', '2022-06-01 06:11:18', 5, 'Jesper Bralten', 'Keysoftware Domein Opzetten', '<p>In deze handleiding wordt uitgelegd hoe je een keysoftware domein opzet en daar keysoftware op zet!</p><ol><li>Ga naar <a href=\"https://vps.onlinebouwers.nl:2222/\">https://vps.onlinebouwers.nl:2222/</a> en login als keysoftware.nl</li><li>Klik onder <strong>Account manager</strong> op Add New User</li><li>Vul hier de <strong>gegevens </strong>in van het <strong>bedrijf</strong>, <strong>genereer een wachtwoord</strong> en de <strong>naam van het subdomein</strong> van keysoftware.nl. bijvoorbeeld, <strong>makelaar.keysoftware.nl.</strong></li><li>Vul bij <strong>email </strong>jouw eigen email in! Hier komen de gegevens te staan die je laten nog nodig hebt!<br><i>(de reden om een nieuw pakket te maken is om het verbruik per domein bij te houden)</i><br><i>(<strong>Kopieer </strong>het gegenereerde <strong>wachtwoord </strong>en <strong>username</strong>, deze heb je laten <strong>nodig</strong>!)</i></li><li>Klik vervolgens op <strong>Submit</strong> (Nu wordt het pakket aangemaakt. Letop! Dit kan even duren!)<br>&nbsp;</li><li>Als je nu naar het nieuwe <strong>subdomein </strong>gaat doet hij het waarschijnlijk nog niet dit duurt even. Hier krijg je ook nog een <strong>mailtje </strong>van.</li><li>In de mail staan jouw gebruikersnaam en wachtwoord als je ze vergeten bent te kopiÃ«ren, als de mail er nog niet is wacht daar eerst op.<br>&nbsp;</li><li>Log vervolgens als de nieuwe user in.</li><li>Klik onder <strong>System info &amp; Files</strong> op <strong>File manager</strong></li><li>Ga vervolgens naar: <strong>`domains/[domein naam]`/</strong></li><li>Maak hier het mapje <strong>project </strong>aan (geen hoofdletters gebruiken!).<br>&nbsp;</li><li>Ga vervolgens onder <strong>Account manager</strong> naar <strong>MySQL Management</strong></li><li>Klik hier op <strong>Create new database</strong></li><li>Vul in de velden gewoon `<strong>_data</strong>` in dan zou je database naam bijvoorbeeld, `makelaar_data` zijn.</li><li>Bij het wachtwoord vul je vervolgens het <strong>wachtwoord </strong>in die je hebt <strong>gekopieerd</strong>.<br>&nbsp;</li><li>Ga nu naar <a href=\"https://onlinebouwers.deployhq.com/\">https://onlinebouwers.deployhq.com/</a> en login met jouw gegevens.</li><li>Klik op het project <strong>Keysoftware </strong>en ga naar<strong> Servers &amp; Groups</strong></li><li>Klik vervolgens op <strong>New Server</strong></li><li>Bij <strong>Name </strong>vul je het volledige domein naam in, bijvoorbeeld <strong>makelaar.keysoftware.nl</strong></li><li>Bij <strong>Group </strong>selecteer je <strong>No Server Group</strong></li><li>Bij <strong>Protocol </strong>selecteer je <strong>SSH/FTP</strong><ol><li><strong>Hostname: </strong>hier vul je het volledige domein naam in, bijvoorbeeld <strong>makelaar.keysoftware.nl</strong></li><li><strong>Port: 2020</strong></li><li><strong>Username: </strong>Hier vul je de username in die je hebt gekopieerd.</li><li><strong>Password: </strong>Hier vul je het wachtwoord in die je hebt gekopieerd.</li><li><strong>Deployment path: </strong>Hier vul je `domains/<strong>[volledige domein naam]</strong>/project` in, bijvoorbeeld `domains/makelaar.keysoftware.nl/project`</li></ol></li><li>Klik vervolgens op <strong>Create Server</strong><br>&nbsp;</li><li>Ga vervolgens weer naar <strong>Servers &amp; Group </strong>en klik op jouw nieuwe server</li><li>Klik vervolgens op <strong>Deploy Project</strong><ol><li><strong>Branch: </strong>Main</li><li><strong>Start Revision: </strong>klik bij start revision aan de rechterkant op de paarse knop<ol><li>Nu opent er een popup</li><li>Onderin staat een vinkje `<strong>Deploy the entire repository?</strong>` vink deze aan</li><li>Klik vervolgens op <strong>choose revision</strong></li></ol></li></ol></li><li>Vervolgens klik je op <strong>Deploy</strong> (groene knop)<br>&nbsp;</li><li>Ga nu vervolgens naar <a href=\"https://ob.customerr.nl/keysoftware\">https://ob.customerr.nl/keysoftware</a></li><li>Klik op het plusje en maak een nieuwe klant aan.<ol><li>Vul hier alle gegevens in.</li><li>Klik vervolgens op <strong>Toevoegen</strong></li></ol></li><li>Klik vervolgens op de klant die je hebt toegevoegd.</li><li>Op die pagina zie je onderin een `<strong>api token</strong>` kopieer deze.<br>&nbsp;</li><li>Ga vervolgens naar<strong> </strong>jouw nieuwe <strong>keysoftware domein</strong> en <strong>login </strong>in met de juiste gegevens. bijvoorbeeld `<strong>makelaar.keysoftware.nl</strong>`.</li><li>Klik vervolgens op instellingen en <strong>scroll dan naar beneden</strong>.</li><li>Klik vervolgens op het logo van OnlineBouwers.nl</li><li>Plak in het tekstveld de api token. en sla vervolgens op<br>&nbsp;</li><li>Maak vervolgens een <strong>account </strong>aan voor de makelaar. De makelaar krijgt <strong>automatisch een mail met de inloggegevens</strong>!</li><li><strong>Klaar</strong>! Je hebt nu een Keysoftware project opgezet!</li></ol>'),
(24, '2022-06-16 10:14:37', '2022-06-16 10:14:37', 5, 'Jesper Bralten', 'Custom Ontwerp Cms Modules', '<p>In deze handleiding wordt uitgelegd hoe je een custom ontwerp maalt voor cms modules</p><p>&nbsp;</p><p><strong>Bestands locatie vinden</strong></p><ol><li>In de map:<i> resources/views/templates/admin/modules/includes/custom</i> kan je de bestanden vinden waarmee je dus een custom module kan maken</li><li>Als je de functionaliteit wilt van het originele ontwerp kan je het originele bestand vinden in de map &nbsp;resources/views/templates/admin/modules</li><li><strong>Kopieer</strong> de inhoud van het bestand, niet het bestand zelf en plak dat vervolgens in het âcustomâ bestand</li></ol><p>&nbsp;</p><p><strong>Instelling veranderen voor het custom ontwerp</strong></p><ol><li>Ga bij de betreffende cms website naar de database toe.&nbsp;</li><li>Ga vervolgens naar het settings tabel</li><li>hierin zie je een aantal regels staan die met â<i>custom_</i>â beginnen. Om gebruik te maken van het âcustomâ ontwerp moet de value omgezet worden naar <strong>1</strong></li><li>Als je gebruik wilt maken van het originele ontwerp kan je de value omzetten naar <strong>0</strong></li></ol><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>'),
(25, '2022-11-07 13:02:56', '2022-11-07 13:02:56', 1, 'Kevin Bolhuis', 'Outlook instellingen mail', '<p><strong>Server 1</strong></p><p>server inkomend: mail.onlinebouwers.nl</p><p>inkomende poort: 993</p><p>SSL aan</p><p>server uitgaand: mail.onlinebouwers.nl</p><p>uitgaande poort: 587</p><p>beveiliging: automatisch</p><p>&nbsp;</p><p><strong>Server 2</strong></p><p>server inkomend: mail.online-bouwers.nl</p><p>inkomende poort: 993</p><p>SSL aan</p><p>server uitgaand: mail.online-bouwers.nl</p><p>uitgaande poort: 587</p><p>beveiliging: automatisch</p>');
