(1839, 43, 1, '13:00:00', '16:00:00', '2022-02-24', 'Declarabel', '<p>Regels kunnen toevoegen aan de facturen tussen de bestaande regels in.<br />\nBij alle regels een plusje plaatsen om te clonen, ook een min bij de laatste regel.<br />\nBij offertes iedere keer een nieuwe offerte nummer koppelen, het oude nummer opslaan in het archief.<br />\nFacturen overzicht wat anders indelen zodat de openstaande, verzonden en verlopen in dezelfde tabel komen te staan.<br />\nMet de checkboxes op het facturen overzicht in 1x meerder herinneringen kunnen versturen via de mail.</p>\n', NULL, '2022-02-24 14:59:38', '2022-02-24 14:59:38'),
(1840, 14, 1, '16:00:00', '17:00:00', '2022-02-24', 'Declarabel', '<p>Jesper af en toe mee helpen&nbsp;</p>\n', NULL, '2022-02-24 15:00:01', '2022-02-24 15:00:01'),
