(1842, 43, 1, '09:00:00', '10:30:00', '2022-02-25', 'Niet Declarabel', '<p>Cronjob laten werken voor het veranderen van de factuur statussen naar verlopen.<br />Reistijd ook meerekenen in het uren overzicht.<br />Debiteuren en Crediteuren pagina layout aangepast zoals Robert het aangaf.</p>', NULL, '2022-02-25 11:41:07', '2022-02-25 11:50:38'),
(1843, 43, 1, '10:30:00', '12:30:00', '2022-02-25', 'Declarabel', '<p>Het projectenoverzicht bij een debiteur de projecten splitsen tussen lopend en afgerond en sorteren op status.<br />\nBij het projectoverzich (debiteuren) moeten er totaalbedragen komen onder elke status bij lopende projecten.<br />\nBij lopende projecten, afgeronde projecten, offertes en facturen een totaalbedrag plaatsen.</p>\n', NULL, '2022-02-25 11:43:14', '2022-02-25 11:43:14'),
(1844, 52, 1, '13:30:00', '13:45:00', '2022-02-25', 'Niet Declarabel', '<p>Reageren op Gert, hij geeft akkoord voor de offerte.</p>\n', NULL, '2022-02-25 11:44:00', '2022-02-25 11:44:00'),
