(2065, 14, 5, '09:00:00', '16:00:00', '2022-03-22', 'Declarabel', '<p>- Optimalisaties - (bestanden per project) Veel gebruikte bestanden die eigenlijk maar 1 keer worden gebruikt staan nu op 1 centraal punt.<br />\n- Blokken op het dashboard zijn nu interactief, er staat nu een knop naar aanbod. Bezichtiging afspraken zijn verwijderd. aanmeldingen is gewijzigd naar nieuwe leads<br />\n- Agenda punten staat op je dashboard.<br />\n- Onder stattus staan alle planningen van deze maand.<br />\n- Bij snelle acties kan je snel facturen maken.<br />\n- Provincie bij afspraken is weg<br />\n- Bij instellingen kan je nu aangeven wanneer de makelaar open is en van hoelaat tot hoelaat.<br />\n- Agenda titel wordt nu automatisch ingevuld met onderwerp en datum<br />\n- Navigatie balk staat standaard open<br />\n- Biedingen staan naast gegevens bij de woning<br />\n- Agenda staat naar planning<br />\n- Foutmelding met $bids is opgelost<br />\n- Bungalow is nu zonder dak<br />\n- Courtage is in percentage en wordt nu berekent tijdens het opslaan (er komt nog een functie waarbij dit live gebeurd)<br />\n- Offerte ref. nummer is weg<br />\n- Blokjes staan nu netjes in rijtjes voor een duidelijk overzicht plus ze zijn gesorteerd.<br />\n- Warm water is nu ook een blok met opties<br />\n- Tabs zijn weer zichtbaar<br />\n- Knoppen op het stappenplan zijn even groot<br />\n- Prijs per parkeerplaats is hernoemd<br />\n- Datum ont. vooraarden financiering staat boven datum waarborg<br />\n- Bowukundig transport hernoemd naar bouwkundig rapport plus veranders naar een ja/nee vraag<br />\n- netzo voor NHG<br />\n- Transactie status is er uit<br />\n- Peildatum woz staat bij woz, en is een datum input.<br />\n- Als je naar de volgende stap gaat ga je weer naar boven<br />\n- Keurmerken is een select geworden met opties<br />\n- Warm water is ook een select geworden met opties<br />\n- Woonoppervlak t/m perceel staat nu in een nieuw tab genaamd &#39;oppervlaktes&#39;</p>\n', NULL, '2022-03-22 14:53:37', '2022-03-22 14:53:37'),
