(2114, 48, 1, '09:30:00', '16:00:00', '2022-03-28', 'Declarabel', '<p>Bij jansen op locatie werken en punten aanpassen wat ze mij doorgeven.<br />\nIk had een hele lijst met aanpassingen maar die is niet opgeslagen.<br />\n<br />\n- Filter op dashboard voor werkdagen.<br />\n- Vakantiedagen instellingen bouwen zodat gebruikers dit kunnen inzien.<br />\n- Omschrijving opslaan bij werkbonnen aanmaken en wijzigen.<br />\n- Het hele media gedeelte gemaakt bij het bekjken van een project.<br />\n- Gebruikt materiaal/materieel tab gemaakt bij het bekijken van een project.<br />\n- Inkoopprijzen kunnen inladen bij het exporteren en importeren van een excel bestand.<br />\n- Inkoopprijzen inbouwen bij producten.</p>\n\n<p>Dit waren de punten die ik me nog kan herinneren.</p>\n', NULL, '2022-03-29 05:05:56', '2022-03-29 05:06:13'),
(2115, 14, 5, '09:00:00', '12:30:00', '2022-03-29', 'Declarabel', '<p>Bezig gegaan met het toevoegen van de acte van levering aan het systeem. Deze werkt nu naar behoren.</p>\n\n<p>Ook andere punten zijn behandeld</p>\n', NULL, '2022-03-29 08:32:55', '2022-03-29 08:32:55'),
(2116, 48, 1, '09:00:00', '16:00:00', '2022-03-29', 'Declarabel', '<p>Vandaag weer op locatie gewerkt bij Jansen, de onderstaande punten verwerkt:<br />\n- Bij het verwijderen van een project ook de bonnen en uren verwijderen.<br />\n- Telefoon nr inladen bij het selecteren van een contactpersoon bij het aanmaken van een project.<br />\n- Vakantiedagen ook in de planning zetten en hier niet op kunnen klikken.<br />\n- Oude debiteur nummers inladen.<br />\n- Functie schrijven die klanten zonder debiteur nummer een oplopend nummer geeft.<br />\n- Functie schrijven die debiteur nummers koppeld bij het aanmaken van een nieuwe klant.<br />\n- Kunnen zoeken op debiteur nummer.<br />\n- Alle uren die staan gekoppeld aan een verwijderd project eruit gehaald.<br />\n- Correcties van uren doorgevoerd op alle bestaande weken.<br />\n- Bij het wijzigen van een bon moet de project niet meer aangepast kunnen worden.<br />\n- Layout van de hele factuur nagebouwd.<br />\n- Lege regels kunnen toevoegen aan een factuur met alleen een omschrijving.<br />\n- Factuur regels kunnen verplaatsen naar beneden zodat de volgorde wordt aangepast.<br />\n- Mail instellingen ingevoerd zodat facturen gemaild kunnen worden.<br />\n- Testen of facturen verzonden kunnen worden vanuit het systeem.<br />\n- Categorie&euml;n sorteren op naam bij het inladen.</p>\n', NULL, '2022-03-29 10:43:43', '2022-03-29 12:31:34'),
