(2180, 73, 5, '09:00:00', '12:30:00', '2022-04-06', 'Declarabel', '<p>Bezig gegaan met de nieuwe punten van de offerte.</p>\n\n<p>Groepen kunnen nu worden aangemaakt</p>\n\n<p>medewerkers kunnen worden gekoppeld aan de groep</p>\n\n<p>Medewerkers kunnen worden verwijderd van de groep</p>\n\n<p>groepen kunnen worden verwijderd</p>\n\n<p>groepen kunnen worden bewerkt.</p>\n\n<p>De medewerker ziet op zijn eigen pagina in welke groepen diegene zit</p>\n', NULL, '2022-04-06 08:06:27', '2022-04-06 09:15:01'),
(2181, 48, 1, '11:30:00', '16:00:00', '2022-04-06', 'Declarabel', '<p>- Filter bij uren overzicht onthouden.<br />\n- Onder handen status als eerst tonen.<br />\n- Overige uren op het dashboard werden niet goed ingeladen, dit gefixed.<br />\n- Planning voor gebruikers aangepast zodat ze alleen zichzelf zien met hun eigen projecten.<br />\n- Datum van filter op dashboard overnemen bij uren invullen.<br />\n- In de kalender alleen de werktijden tonen, de rest kan eruit.<br />\n- Regulier uren kunnen invullen per medewerker, dit bij het aanmaken en wijzigen.<br />\n- tabs en collapsible bij weekstaten groen maken wanneer iemand reguliere uren heeft gehaald.<br />\n- Weekstaten ombouwen zodat de uren per medewerker ingezien kunnen worden ipv per project.<br />\n- Dagnamen geplaatst bij de datums van de gewerkte uren op het dashboard.<br />\n- Gebruikte vrije invoer materialen weer selecten bij het wijzigen van een bon.<br />\n- Gebruikte materiaal/materieel ook tonen bij gebruikers maar dan de prijzen eruit halen.</p>\n', NULL, '2022-04-06 09:40:58', '2022-04-06 12:09:23'),
