(2522, 48, 1, '09:00:00', '16:30:00', '2022-06-13', 'Declarabel', '<p>- Ingevuld materiaal/materieel uit de werkbonnen halen.<br />\n- Via de weekstaten bij gebruikt materiaal/materieel een functie bouwen voor het aanpassen.<br />\n- Bij selecteren van een project direct de klant inladen.<br />\n- Bij het selecteren van een klant ook direct het adres inladen als die bekend is.<br />\n- Deadline = Startdatum<br />\n- Direct foto&#39;s uploaden bij actiepunten<br />\n- Materiaal met komma getallen kunnen gebruiken.<br />\n- Geboekt materiaal kunnen verwijderen via de materialen lijst bij een project.<br />\n- Tekening kunnen plaatsen bij het aanmaken van een actiepunt.</p>\n', NULL, '2022-06-13 08:38:30', '2022-06-13 11:57:59'),
(2523, 46, 1, '09:30:00', '15:00:00', '2022-06-10', 'Niet Declarabel', '<p>- In de shop zelf een knop bij ieder artikel zetten voor info en de bestaande knop aanpassen zodat die het artikel toevoegd aan de winkelwagen.<br />\n- Proberen afbeeldingen in te laden met de synchronisatie.</p>\n', NULL, '2022-06-13 08:45:12', '2022-06-13 08:45:34'),
