(2592, 48, 1, '10:00:00', '17:00:00', '2022-06-24', 'Declarabel', '<p>- Facturen kunnen aanmaken vanuit een project.<br />\n- Kunnen selecteren met checkboxes of manuren en materiaal/materieel gefactureerd moet worden.<br />\n- Duidelijk kunnen zien hoeveel uren/items er klaar staan voor facturatie vanuit een project.<br />\n- Te factureren materiaal/materieel kunnen uitklappen om te bekijken wat er meegestuurd wordt.<br />\n- Alle gefactureerde items ook op gefactureerd zetten zodat dit niet dubbel wordt gefactureerd.<br />\n- De volgorde van de items die worden ingeladen op de juiste volgorde zetten.<br />\n- Dubbele items laten zien als 1 item met meerdere aantallen.<br />\n- De verzenddatum ook vullen bij het printen van een factuur (mogelijkheid d.m.v. swal2)<br />\n- Het juiste bedrag berekenen bij het genereren van een factuur vanuit een project.<br />\n- Bij het verwijderen van een concept factuur de producten en uren bij het project weer kunnen factureren.<br />\n- Startdatum kunnen aanpassen bij het aanmaken/wijzigen van gebruikers.<br />\n- Werkbare uren berekening fixen.<br />\n- Layout van media bij project wijzigen.<br />\n- Eenheid uren meenemen bij uren in factuur.<br />\n- Print factuur openen in nieuwe tab.<br />\n- Projecten bij gebruikers neer zetten.<br />\n- Factuur PDF zo aanpassen dat de de tekst nooit door het logo komt vanaf de 2e pagina.<br />\n- Planning kunnen printen om de view die je bekijkt.<br />\n- Gebruikers toevoegen aan een project soms buggie.<br />\n- Optie in urenoverzicht voor het in 1x (de)selecteren van alle gebruikers en weken.<br />\n- Wat bugs fixen bij het doorzetten van een project naar een factuur.</p>\n', NULL, '2022-06-24 09:26:15', '2022-06-24 12:34:44'),
(2593, 48, 1, '09:00:00', '10:30:00', '2022-06-27', 'Declarabel', '<p>Facturen kunnen genereren d.m.v het selecteren van bepaalde weken onder een project. Alle ingevulde uren/materiaal/materieel wordt ingeladen van de geselecteerde weken.</p>\n', NULL, '2022-06-27 06:30:22', '2022-06-27 06:30:22'),
(2594, 21, 1, '10:30:00', '10:45:00', '2022-06-27', 'Jaarfactuur', '<p>Plaatje op de home pagina weer aanpassen</p>\n', NULL, '2022-06-27 06:37:45', '2022-06-27 06:37:45'),
(2595, 92, 1, '10:45:00', '16:00:00', '2022-06-27', 'Niet Declarabel', '<p>- Database tabel toevoegen en functies ombouwen zodat bij sommige statussen custom buttons gebruikt kunnen worden.<br />- Database zo aanpassen dat er meerdere bestanden kunnen worden ge&uuml;pload.<br />- De preview van bestanden herbouwen omdat er nu meerdere bestanden in 1 status kunnen staan.<br />- Via de preview de bestanden 1 voor 1 kunnen verwijderen.<br />- De complete status kan worden gereset mocht er wat fout gaan.</p>', NULL, '2022-06-27 08:09:20', '2022-06-28 07:50:51'),
