(2849, 46, 1, '09:00:00', '15:30:00', '2022-09-02', 'Declarabel', '<p>- Alle overbodige percentage functies, tabellen, imports en exports uit de code/systeem halen.<br />\n- Export en import van producten gelijk maken aan elkaar en testen, dit werkt nu.<br />\n- Beschikbaarheids kleur instellen bij producten.<br />\n- Beschikbaarheid aanpassen met ajax.<br />\n- Complete berekening per product herschrijven omdat de berekening van NPI een aparte berekening is.<br />\n- Nog een export functie erbij gemaakt, Reinier wou de PDF export ook in Excel formaat hebben naast de huidige Excel export.<br />\n- Alle export bestanden aangepast met de nieuwe berekeningen.<br />\n- Alle exports testen<br />\n- Nieuwe import functie gemaakt voor het uploaden van de sub-categorie percentages per klant.<br />\n- De bovengenoemde import kunnen aanroepen vanaf de klanten overzicht en bij het bekijken van een klant.<br />\n- De bovengenoemde import ook kunnen exporteren zodat deze aangepast kan worden en daarna weer geimporteerd kan worden.<br />\n&nbsp;</p>\n', NULL, '2022-09-02 12:19:47', '2022-09-02 12:19:55'),
