(3057, 52, 1, '09:00:00', '09:15:00', '2022-11-07', 'Declarabel', '<p>Armslag belde, ze wil de checkboxes voor het activeren onder elkaar hebben. (10 min. gebeld en 5 min. aanpassen)</p>\n', NULL, '2022-11-07 07:59:06', '2022-11-07 07:59:06'),
(3058, 73, 1, '09:15:00', '16:00:00', '2022-11-07', 'Declarabel', '<p>Wpis kunnen printen als PDF.<br />\nWpis kunnen invullen als bedrijf of preventiemedewerker, dit omdat de antwoorden van de geprinte versie ook in het systeem moeten.<br />\nWpi naam kunnen invoeren en wijzigen.<br />\nWpis zo ombouwen dat de tabel wpi_fields weg kan en dat er custom names gebruikt kunnen worden.<br />\nInstellingen pagina maken voor werkplekinspectie punten.<br />\nWerkplekinspectiepunten kunnen aanmaken.<br />\nDe aangemaakte wpi punten ook meenemen in het hele process.<br />\nWpis kunnen kopie&euml;ren en alle data behalve vragen overnemen.<br />\nFeedback modal aanpassen en de mail wijzigen naar natasha@nrdoet.nl, bcc naar kevin@onlinebouwers.nl<br />\nAlle wijzigingen pushen naar github en mergen met Main.<br />\nWijzigingen online testen.<br />\nMail sturen naar Natasha.</p>\n', NULL, '2022-11-07 09:09:05', '2022-11-07 14:58:08'),
(3059, 73, 5, '09:00:00', '12:00:00', '2022-11-07', 'Declarabel', '<p>Bezig gegaan met het dashboard en functie zodat alleen natascha eerst kan inloggen om het systeem te laten zien</p>\n', NULL, '2022-11-07 09:53:58', '2022-11-07 09:53:58'),
