(3079, 107, 1, '15:00:00', '16:00:00', '2022-11-10', 'Niet Declarabel', '<p>Geld lenen kost geld afbeelding weg gehaald.<br />Op het gehele blok kunnen klikken om naar een voertuig te gaan.<br />Alleen op documenten vragen bij zakelijke lease aanvraag.<br />Particulier aanvragen niet naar Maex sturen.<br />Bedankt tekst in de groene kleur van Interlease.<br />Bij een leeg KVK nr. krijg je nu geen gek bedrijf meer ingeladen. &nbsp;&nbsp;<br />Footer donker maken op de site en alle tekst en afbeeldingen wit.<br />E-mail, whatsapp en telefoon nr. links laten werken in de footer.<br />De links in de header laten werken met telefoon nr. en e-mail.</p>', NULL, '2022-11-10 14:03:59', '2022-11-25 09:19:21'),
