(3102, 48, 1, '09:00:00', '15:30:00', '2022-11-14', 'Declarabel', '<p>Klant gegevens kunnen aanpassen.<br />\nZoeken in projecten archief is niet mogelijk<br />\nAlle weken in 1x kunnen selecteren bij het aanmaken van een factuur vanuit een project.<br />\nTabs bij actielijst maken voor offertes en onderhanden.<br />\nActielijst punten die afgerond zijn naar archief plaatsen.<br />\nProject van een bon kunenn wijzigen, alleen moderator en admin mogen dit doen.<br />\nKlantnaam ook zien bij uren invullen, zo kan er ook gezocht worden op klantnaam.<br />\n|Pagination bij producten<br />\nKlanten aanpassen naar relaties in navigatiebalk, die is nu een dropdown.<br />\nPagina maken met onderaannemers met toevoegen/wijzigen en verwijderen.<br />\nGemiddelde ziektedagen pp kunnen instellen via instellingen, dit wordt meegenomen in berekening beschikbare uren.<br />\nAanmaken van gebruiker foutmelding<br />\nModerator rol bij gebruikers aanmaken</p>\n', NULL, '2022-11-14 10:36:00', '2022-11-15 14:49:52'),
(3103, 29, 2, '11:30:00', '12:00:00', '2022-11-15', 'Declarabel', '<p>koppeling trade tracker</p>\n', NULL, '2022-11-15 10:10:21', '2022-11-15 10:10:21'),
(3104, 1, 2, '09:00:00', '11:00:00', '2022-11-15', 'Niet Declarabel', '<p>bruisballen</p>\n\n<p>mails</p>\n\n<p>administratie</p>\n', NULL, '2022-11-15 10:10:40', '2022-11-15 10:10:40'),
(3105, 48, 1, '09:00:00', '15:30:00', '2022-11-15', 'Declarabel', '<p>Naar jansen toe.<br />\nProducten en groepen kunnen toevoegen bij het wijzigen van een offerte.<br />\nPrijzen toevoegen wanneer materiaal/materieel wordt toegevoegd aan een werkbon.<br />\nBeschikbare uren berekening wat aanpassen.<br />\nSubtotalen op de facturen fixen wanneer een project wordt doorgezet naar een factuur.<br />\nDe eenheden fixen bij de facturen tab onder een project.<br />\nDebiteur nummers kunnen aanpassen, hier ook een check inbouwen voor unieke nummers</p>\n', NULL, '2022-11-15 10:53:04', '2022-11-15 13:20:07'),
